        def shortest_path(x, y, path):
            if path[-1][0] == x and path[-1][1] == y:
                return path
            if len(path) == 1:
                return []
            if is_valid_path(x - 1, y, path):
                return shortest_path(x - 1, y, path)
            if is_valid_path(x, y + 1, path):
                return shortest_path(x, y + 1, path)
            return shortest_path(x + 1, y, path)

        def valid_paths(x, y, packages):
            path = [((x, y))]
            if is_valid(path[-1], packages):
                return [[path[-1]]] + valid_paths(x + 1, y, packages)
            if is_valid(path[-1], packages):
                return [[path[-1]]] + valid_paths(x, y + 1, packages)
            return []

        def find_shortest_path(x, y, packages):
            shortest_path_list = valid_paths(x, y, packages)
            shortest_path = []
            for path in shortest_path_list:
                shortest_path = shortest_path + path
            return shortest_path

        def find_best_path(x, y, packages):
            shortest_path = find_shortest_path(x, y, packages)
            if len(shortest_path) == 1:
                return shortest_path
            path = shortest_path + [(x, y)]
            for i in range(len(path) - 1):
                for j in range(i + 1, len(path)):
                    if not is_valid_path(path[i][0], path[i][1], path[j]) and not is_valid_path(path[j][0], path[j][1], path[i]):
                        path[i], path[j] = path[j], path[i]
            return path

        def move_robot(x, y, path):
            if is_valid_path(x + 1, y, path):
                return move_robot(x + 1, y, path)
            if is_valid_path(x, y + 1, path):
                return move_robot(x, y + 1, path)
            return [(x, y)]

        def collect_packages(x, y, path):
            if path == [(x, y)]:
                return [(x, y)]
            if is_valid_path(x, y, path):
                path = move_robot(x, y, path)
                return [(x, y)] + collect_packages(x, y, path)
            return collect_packages(x + 1, y, path)

        for x, y in packages:
            path = [(x, y)]
            while path!= [(0, 0)]:
                path = collect_packages(x, y, path)

        for x, y in packages:
            path = [(x, y)]
            while path!= [(0, 0)]:
                path = shortest_path(x, y, path)

        result.append(any(p!= [(0, 0)] for p in packages))

    return ''.join(map(str, result))


