    # read input
    n = int(stdin.readline().strip())
    a = list(map(int, stdin.readline().strip().split()))

    # build graph
    graph = [[] for _ in range(n+1)]
    for i, v in enumerate(a):
        graph[v].append(i+1)

    # dfs
    visited = [False] * (n+1)
    parent = [None] * (n+1)
    stack = [(0, 0)]
    while stack:
        vertex, level = stack.pop()
        if not visited[vertex]:
            visited[vertex] = True
            parent[vertex] = level
            for neighbor in graph[vertex]:
                if not visited[neighbor]:
                    stack.append((neighbor, level+1))

    # find max difference
    max_diff = 0
    for i in range(n):
        for j in range(i+1, n+1):
            diff = abs(graph[i][0] - graph[j][0]) + abs(graph[i][1] - graph[j][1])
            max_diff = max(max_diff, diff)

    # print result
    res = [0] * n
    res[0] = max_diff
    for i in range(1, n):
        for j in range(i+1, n+1):
            res[i] = max(res[i], res[j] + max_diff)

    return '\n'.join(map(str, res))

