    def polynomial_value(x, coefficients):
        result = 1
        for i in range(len(coefficients) - 1):
            result *= x
            result -= coefficients[i]
        result *= coefficients[-1]
        return result

    def derivative_value(x, coefficients):
        result = 0
        for i in range(len(coefficients) - 1):
            result += coefficients[i] * x ** i
        result += coefficients[-1] * x ** (len(coefficients) - 1)
        return result

    def finite_differences(sequence, n):
        differences = []
        for i in range(1, len(sequence)):
            differences.append(derivative_value(sequence[i] - sequence[i - 1], sequence[i - 1:i + n]))
        return differences

    def minimal_degree_polynomial(sequence, n):
        coefficients = [sequence[i] for i in range(n)]
        coefficients.append(sequence[-1])
        return polynomial_value(sequence[-1], coefficients)

    next_regularly_spaced_value = sequence[-1] + (sequence[-1] - sequence[0]) / 20

    if n == 1:
        return f"{minimal_degree_polynomial(sequence, 1)} {next_regularly_spaced_value}"

    differences = finite_differences(sequence, n)
    result = [derivative_value(sequence[i], differences) for i in range(n + 1)]

    return f"{result[0]} {result[1]}"

